def test_py_factorial():
    import math
    from fluids.numerics.special import py_factorial
    try:
        py_factorial((- 3))
        assert False, 'Expected ValueError for negative input to factorial'
    except ValueError:
        pass
    assert (py_factorial(0) == 1)
    assert (py_factorial(20) == math.factorial(20))
    try:
        py_factorial(7.0)
        assert False, 'Expected TypeError for float input to factorial'
    except TypeError:
        pass
    try:
        py_factorial(15.0)
        assert False, 'Expected TypeError for float input to factorial'
    except TypeError:
        pass
    try:
        py_factorial(7.5)
        assert False, 'Expected TypeError for non-integral float input to factorial'
    except TypeError:
        pass
    assert (py_factorial(30) == math.factorial(30))
    for i in range(35):
        assert (py_factorial(i) == math.factorial(i))

